import React from 'react';

function Hero(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt="Hero" />
    </div>
  );
}

function Enemy(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt="Enemy" />
    </div>
  );
}

function Arena(props) {
  return (
    <div>
      <Hero name={props.heroName} img={props.heroImg} />
      <Enemy name={props.enemyName} img={props.enemyImg} />
    </div>
  );
}

function World(props) {
  return (
    <div>
      {props.children}
    </div>
  );
}

export { Arena, World };
